import Stack from "@mui/material/Stack";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import Link from "@mui/material/Link";
import placeholder from '../assets/img/placeholder-image.png';
import ProjectCardPendo from "./ProjectCardPendo";
import { CustomPalette } from "../theme/palette";
import ProjectCardDL from "./ProjectCardDL";
import { Ditto, DittoComponent } from 'ditto-react';

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary" align="center">
      {"Copyright © "}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const Home = ({}) => {
  return (
    <h1><DittoComponent componentId="home-page.intro"></DittoComponent></h1>


  );
}

export default Home;
